import logo from './logo.svg';
import './App.css';
import {useState, useEffect} from "react";
import Axios from "axios";
import { Formik, Field, Form } from 'formik';

function App() {
    //set begin and end input
    const [begin, setBegin] = useState("");
    const [end, setEnd] = useState("");
    //begin and end coordinate
    const [cor, setCor] = useState(initialValues);

    const initialValues = {
        lat_beg:'', 
        long_beg: '', 
        lat_end: '', 
        long_end: '',
    };


    <Formik initialValues= {{
        lat_beg:'', 
        long_beg: '', 
        lat_end: '', 
        long_end: '',
    }}> 

    </Formik>
    //change begin and end input when it change
    const handleBegin = (event) => {
        setBegin(event.target.value);
        console.log(begin);
    }

    const handleEnd = (event) => {
        setEnd(event.target.value);
        console.log(end);
    }

    //fetch trip information
    const fetchtrip = () => {
        console.log(begin);
        console.log(end);
        Axios.get(`https://developers.onemap.sg/privateapi/routingsvc/route?start=${cor.lat_beg}%2C${cor.long_beg}&end=${cor.lat_end}%2C${cor.long_end}%2C&routeType=pt&token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJzdWIiOjEwMjkwLCJ1c2VyX2lkIjoxMDI5MCwiZW1haWwiOiJwZWt5dWFuQGdtYWlsLmNvbSIsImZvcmV2ZXIiOmZhbHNlLCJpc3MiOiJodHRwOlwvXC9vbTIuZGZlLm9uZW1hcC5zZ1wvYXBpXC92MlwvdXNlclwvc2Vzc2lvbiIsImlhdCI6MTY4MzczMjEzMiwiZXhwIjoxNjg0MTY0MTMyLCJuYmYiOjE2ODM3MzIxMzIsImp0aSI6ImVkNzZiNDdlZGU0OTJmN2UxZjQ2ZTZjOGJiNTY4YmFiIn0.W_EZXGzCM_UP1bMi5RRLFMmY0kbEicOwrJyxtbKwIKw&date=2023-03-12&time=15%3A30%3A00&mode=RAIL&maxWalkDistance=1000`)
            .then((res) => {
                console.log(res);
                var subway_result = res.data.plan.itineraries[0].legs;
                console.log(res.data.plan.itineraries[0].legs);
                var cleaner_result = subway_result.map(x => "from " + x.from.name + " to " + x.to.name);
                console.log(cleaner_result); //without destination, can use the to result of last array element or destination
            });
    }
    const getCoor = () => {
    Axios.get(`https://developers.onemap.sg/commonapi/search?searchVal=${begin}&returnGeom=Y&getAddrDetails=N&pageNum=1`)
            .then((res) => {
                setCor({...cor,              
                    lat_beg: res.data.results[0].LATITUDE,
                    long_beg: res.data.results[0].LONGITUDE
                })
            });
    Axios.get(`https://developers.onemap.sg/commonapi/search?searchVal=${end}&returnGeom=Y&getAddrDetails=N&pageNum=1`)
            .then((res) => {
                setCor({...cor,              
                    lat_end: res.data.results[0].LATITUDE,
                    long_end: res.data.results[0].LONGITUDE
                })
            });
    }
    const fetchData = () => {
        getCoor();
        console.log(cor.lat_beg);
        console.log(cor.long_beg);
        console.log(cor.lat_end);
        console.log(cor.long_end);
        fetchtrip();
    }


  return (
    <div className="App">
      <input onChange={handleBegin} />
      <input onChange={handleEnd} />
      <button onClick={fetchData}> search </button>
    </div>
  );
}
